import React, { Component } from 'react';


class App extends Component{
  constructor(props) {
    super(props)
    this.state = {
        saludos: []
    }
}


  componentDidMount(){
    fetch("http://localhost:8080/saludo")
    .then(response => {
      return response.json();
    })
    .then(data =>{
      console.log(data);
    })
  }

  render(){
    return(
      <div>
        <h1>Hola </h1>
      </div>
    )
  }
}
export default App;
